    { name = "black" },
    { name = "flake8" },
    { name = "flake8-pyproject" },
    { name = "isort" },
    { name = "mypy" },
    { name = "pre-commit" },
    { name = "pytest" },
    { name = "pytest-cov" },
]

[package.metadata]
requires-dist = [
    { name = "matplotlib", marker = "extra == 'all'" },
    { name = "numpy", specifier = ">=1.26.3" },
    { name = "pandas", specifier = "==2.2.3" },
]

[package.metadata.requires-dev]
